using System;
using System.Collections.Generic;
using System.Linq;
using NUnit.Framework;

namespace ShortestPath
{
	public class WeightedDagTests
	{
		[Test]
		public void SimpleGraph()
		{
			var map = new WeightedDag();
			var result = map.ShortestPath(4,new[,]
			{
				{ 0, 1, 1 }, { 0, 2, 5 }, { 0, 3, 5 }, { 1, 3, 3 },
				{ 2, 3, 1 }
			});
			Assert.That(result,Is.EqualTo(4));
		}

		[Test]
		public void BitLongerGraph()
		{
			var map = new WeightedDag();
			var result = map.ShortestPath(3,new[,]
			{
				{ 0, 1, 7 }, { 1, 2, 5 }, { 0, 2, 12 }
			});
			Assert.That(result,Is.EqualTo(12));
		}

		[Test]
		public void NoPath()
		{
			var map = new WeightedDag();
			var result = map.ShortestPath(5,new[,]
			{
				{ 0, 2, 1 }, { 1, 2, 1 }, { 0, 3, 1 }, { 1, 4, 1 }
			});
			Assert.That(result,Is.EqualTo(-1));
		}

